def is_sg_by_zip(elem):
    for tag in elem.iter("tag"):
        k = tag.attrib['k']
        v = tag.attrib['v']
        if k =='addr:postcode':
            if v in MY_POSTCODES or v in ID_POSTCODES:
                return False
    return True

def is_batam_source(elem):
    for tag in elem.iter("tag"):
        k = tag.attrib['k']
        v = tag.attrib['v']
        if k =='source' and v.find("Batam") > -1:
            print("{} is {}".format(k, v))
            return True
    return False

def is_sg_by_primary_keys(elem):

    for tag in elem.iter("tag"):
        k = tag.attrib['k']
        v = tag.attrib['v']
        if k in PRIMARY_KEYS and v in PRIMARY_Non_SG_Values:
            return False

    return True

def is_sg(elem):
    for tag in elem.iter("tag"):
        k = tag.attrib['k']
        v = tag.attrib['v']
        if k in PRIMARY_KEYS and v in PRIMARY_Non_SG_Values:
            print("{} is {}".format(k, v))
            return False
        elif k =='addr:postcode' and (v in MY_POSTCODES or v in ID_POSTCODES):
            print("{} is {}".format(k, v))
            return False
        elif k =='addr:street' and v in NON_SG_Streets:
            print("{} is {}".format(k, v))
            return False
        elif k =='addr:housenumbers' and v in NON_SG_housenumbers:
            print("{} is {}".format(k, v))
            return False
        elif k =='addr:housename' and v in NON_SG_housenames:
            print("{} is {}".format(k, v))
            return False
        elif k =='alt_name' and v in NON_SG_alt_names:
            print("{} is {}".format(k, v))
            return False
        elif k =='int_name' and v in NON_SG_int_names:
            print("{} is {}".format(k, v))
            return False
        elif k =='source' and v.find("Batam") > -1:
            print("{} is {}".format(k, v))
            return False
        elif (k =='name' or k=='place') and v in NON_SG_names:
            print("{} is {}".format(k, v))
            return False
    return True


def get_element(osm_file, tags=('node', 'way', 'relation')):
    """Yield element if it is the right type of tag

    Reference:
    http://stackoverflow.com/questions/3095434/inserting-newlines-in-xml-file-generated-via-xml-etree-elementtree-in-python
    """
    context = iter(ET.iterparse(osm_file, events=('start', 'end')))
    _, root = next(context)

    for event, elem in context:

        if event == 'end' and elem.tag in tags:
            # is_sg_primary = is_sg_by_primary_keys(elem)
            # is_batam = is_batam_source(elem)
            # is_sg_zip = is_sg_by_zip(elem)
            if is_sg(elem):
            # if is_sg_primary and not is_batam and is_sg_zip:
                # print(elem.attrib['id'])
                yield elem
            root.clear()


with open(OUTPUT_OSM_FILE, 'wb') as output:
    output.write(b'<?xml version="1.0" encoding="UTF-8"?>\n')
    output.write(b'<osm>\n')

    # Write every kth top level element
    for i, element in enumerate(get_element(INPUT_OSM_FILE)):
        # if i % k == 0:
        output.write(ET.tostring(element, encoding='utf-8'))

    output.write(b'</osm>')
